import React, { Component } from 'react'
import { Text, View, TouchableOpacity, StyleSheet, Image } from 'react-native'

import global from '../History/global';

export default class Menu extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isLogedIn: false,
        }
        global.loginClick = this.loginClick.bind(this);

    }

    loginClick() {
        this.setState({ isLogedIn: true })
        console.log('hello')
    }

    logoutClick() {
        global.onLogout();
        this.setState({ isLogedIn: false })
    }


    render() {
        const { container, profile, btnStyle, btnText, btnStyleSignIn, btnTextSignIn } = styles;
        const logout = (
            <View style={{ flex: 1 }}>
                <TouchableOpacity style={btnStyleSignIn} onPress={this.props.gotoAuthentication}>
                    <Text style={btnTextSignIn}>Sign In</Text>
                </TouchableOpacity>
            </View>
        )
        const login = (
            <View style={{ flex: 1, alignItems: 'center' }}>
                <Text style={{ color: '#FFF', fontFamily: 'Avenir', fontSize: 20 }}></Text>
                <View style={{ marginTop: 60 }}>
                    <TouchableOpacity style={btnStyleSignIn} onPress={this.props.gotoAuthentication}>
                        <Text style={btnTextSignIn}>To Do Something</Text>
                    </TouchableOpacity>
                    <TouchableOpacity style={btnStyleSignIn} onPress={this.logoutClick.bind(this)}>
                        <Text style={btnTextSignIn}>Log out</Text>
                    </TouchableOpacity>
                </View>
            </View>
        )
        const mainView = this.state.isLogedIn ? login : logout
        return (
            <View style={container}>
                <Image style={profile} source={{ uri: 'data:image/png;base64,' }} />
                {mainView}
            </View>
        )
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#FFA500',
        borderRightWidth: 4,
        borderColor: "#FFF",
        alignItems: 'center'
    },
    profile: {
        width: 120,
        height: 120,
        borderRadius: 60,
        marginVertical: 30
    },
    btnStyle: {
        height: 50,
        backgroundColor: '#FFF',
        borderRadius: 5,
        justifyContent: 'center',
        alignItems: 'center',
        width: 220
    },
    btnText: {
        color: '#FFA500',
        fontSize: 20
    },
    btnStyleSignIn: {
        height: 50,
        backgroundColor: '#FFF',
        borderRadius: 5,
        justifyContent: 'center',
        alignItems: 'center',
        width: 220,
        marginBottom: 10,
        paddingLeft: 10,
    },
    btnTextSignIn: {
        fontSize: 15,
        color: '#FFA500',
    }
})
